import "./App.css";
import { useState, useEffect } from "react";
import axios from "axios";

const baseUrl = "https://pokeapi.co/api/v2/pokemon";

function App() {
  const [data, setData] = useState();

  const axiosUrl = async () => {
    let dats = await axios.get(baseUrl + "/" + 1);
    setData(dats);
  };

  useEffect(() => {
    axiosUrl();
  }, []);

  return (
    <div className="App">
      {data.data.map((res) => {
        return <p>{res.result.name}</p>;
      })}
    </div>
  );
}

export default App;
